import logo from './logo.svg';
import './App.css';
import Header from './components/Home';
import Login from './Login'
import {Routes,Route} from "react-router-dom";

function App() {
  return (
    <div>
      <Routes>
      <Route path='/' element = {<Header/>}/>
      <Route path ="/login" element = {<Login/>}/>
      </Routes>
      
      
      

      
    </div>
  );
}

export default App;
